create database nhom7;
use nhom7;
create table customer(
cid varchar(20) primary key,
name varchar(50),
date_of_birth date,
native_village varchar(50) 
);
create table sim(
phone_number varchar(20) primary key,
id varchar(20),
activation_date date,
status int,
account_ballance int,
constraint fk foreign key (id) references customer (cid)
);
create table call_history(
id int,
number1 varchar(20),
number2 varchar(20),
start_time datetime,
end_time datetime
);















